import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/global.css';

const Home = () => {
  return (
    <div className="home-container">
      <h1>Welcome to Bank to the Future</h1>
      <p>Your financial future... flux-capacitor powered!</p>
      <Link to="/application" className="home-button">
          Get Started
      </Link>
    </div>
  );
};

export default Home;
